import React from 'react'

const Footer = () => {
    return (
        <nav className="nav-wrapper grey darken-3">
            <div className = "fixed-bottom">
                <a className="brand-logo">Our Location</a>
                <p>169 Lees Ave, Ottawa ON</p>
            </div>
        </nav>
    )
}

export default Footer;
